import React, {useState} from 'react'

function Number(props){
    const [number, setNumber] = useState(1)
    return(
        <div>
            <div className="numbers">{number}
                <button onClick={()=>{setNumber(number+1)}}> +</button>
                <button onClick={()=>{setNumber(number-1)}}> -</button>
            </div>
        </div>
    )
}

export default Number
